import React, { Component } from "react";
import { Link } from "react-router-dom";
import MediaQuery from "react-responsive";

import NavBar from "../components/navbar";

import AccountsWeb from "../components/accounts/accountsWeb";
import AccountsMobile from "../components/accounts/accountsMobile";

class Accounts extends Component {
  render() {
    var express = require("express"); // Express web server framework
    var request = require("request"); // "Request" library
    var cors = require("cors");
    var querystring = require("querystring");
    var cookieParser = require("cookie-parser");

    var client_id = "227cced9ee024965a232392f9d6fef70"; // Your client id
    var client_secret = "77423075cabc461d95be888c4bb0efab"; // Your secret
    var redirect_uri = "http://localhost:3000/Accounts"; // Your redirect uri

    return (
      <div class="accounts">
        <NavBar></NavBar>

        <MediaQuery query="(min-device-width: 1224px)">
          <MediaQuery query="(min-width: 1225px)">
            <AccountsWeb></AccountsWeb>
          </MediaQuery>
          <MediaQuery query="(max-width: 1224px)">
            <AccountsWeb></AccountsWeb>
          </MediaQuery>
        </MediaQuery>

        <MediaQuery query="(max-device-width: 1224px)">
          <MediaQuery query="(min-device-width: 1024px)">
            <AccountsMobile></AccountsMobile>
          </MediaQuery>

          <MediaQuery query="(max-device-width: 1023px)">
            <AccountsMobile></AccountsMobile>
          </MediaQuery>
        </MediaQuery>
      </div>
    );
  }
}

export default Accounts;
